void LongitudinalModelPrediction::Init(const LongitudinalDynamicModelParam *lon_dyn_param,  
            const FuelRateModelParam* fuel_rate_param,
            const VehicleConstraintSet* constraint) {

  vehparam_ = lon_dyn_param;
  fuel_rate_param_ = fuel_rate_param;
  constraint_ = constraint;
}

LongitudinalModelPrediction::~LongitudinalModelPrediction(){}

void LongitudinalModelPrediction::Solver(const Float32_t &init_lambda, const PccModelParameter *mpc_config, const PAccInput& input) {
#if ENABLE_PACC_TRACE_DETAIL
  std::cout << "## Longitudinal Model Prediction (begin) >>" << std::endl;
#endif
  // 更新底盘的状态、定位状态、地图状态
  input_ = &input;

  mpc_param_ = mpc_config;
  v_ref_ = input_->cruise_speed;

  mpc_solution_state_ = MpcSolutionInValid;

  if (input_->pacc_map.pacc_point_num < 1) {
    map_s_length_ = 0.0F;
  } else {
    map_s_length_ = input_->pacc_map.points[input_->pacc_map.pacc_point_num - 1].s;
  }

  // 清空计算结果Vector数据 并将当前状态塞入Vector
  prediction_station_points_.Clear();
  prediction_slope_alpha_points_.Clear();
  prediction_vel_points_.Clear();
  prediction_Ft_points_.Clear();
  prediction_Fb_points_.Clear();
  prediction_ax_points_.Clear();
  prediction_lambda_points_.Clear();
  
  Float32_t curr_Ft = input_->engine_torque * input_->engine_speed * 100.0F / input_->ego_speed / 955.0F;

  prediction_vel_points_.PushBack(input_->ego_speed);
  prediction_Ft_points_.PushBack(curr_Ft);
  prediction_Fb_points_.PushBack(0.0F);
  prediction_ax_points_.PushBack(input_->ego_accel);
  prediction_lambda_points_.PushBack(init_lambda);
  
  // 相关参数初始化
  Float32_t prediction_best_Ft = curr_Ft;
  Float32_t prediction_best_Fb = 0.0F;
  Float32_t prediction_best_v = input_->ego_speed;
  Float32_t prediction_best_lambda = init_lambda;

#if ENABLE_PACC_TRACE_DETAIL
  std::cout << std::fixed << std::setprecision(16) << "Ft_0 = " << curr_Ft << ", v_0 = " << prediction_best_v << ", Te_0 = " << input_->engine_torque << ", Ne_0 = " << input_->engine_speed << std::endl;
#endif

  // 空气阻力加速度
  Float32_t aa = vehparam_->environment.cd * vehparam_->Af * vehparam_->environment.rho / 2.0F / vehparam_->environment.mass;
  // 滚动阻力加速度 和 坡度阻力加速度 与 坡度相关
  Float32_t af = 0.0F; 
  Float32_t ag = 0.0F;

  // 当前坡度（rad）
  cur_slope_rad_ = atan(input_->pacc_map.points[0].slope);
  
  prediction_alpha_ = cur_slope_rad_;
  prediction_station_ = 0;

  prediction_station_points_.PushBack(0.0F);
  prediction_slope_alpha_points_.PushBack(cur_slope_rad_);
  
#if ENABLE_PACC_TRACE_DETAIL
  std::cout << "[mpc] lambda_ini = " << init_lambda << ", s_0 = " << prediction_station_ << ", vd_0 = " << v_ref_ << ", v_0 = " << input_->ego_speed 
            << ", M = " << vehparam_->environment.mass << std::endl;
#endif

  // Step5 : 最优求解
#if ENABLE_PACC_TRACE_DETAIL
  std::cout << "[mpc] Start Slover, int lambda :" << prediction_best_lambda << ", map length = " << map_s_length_ << ", predict num = " << mpc_param_->np << std::endl;
#endif

  for (Int32_t i = 0; i < mpc_param_->np; i++) {
    // Step5.1 : 根据 坡度计算 滚动阻力加速度 和 坡度阻力加速度
    af = vehparam_->environment.f * vehparam_->environment.g * (Float32_t)phoenix::common::com_cos(prediction_alpha_);
    ag = vehparam_->environment.g * (Float32_t)phoenix::common::com_sin(prediction_alpha_);

#if ENABLE_PACC_TRACE_DETAIL
  std::cout << "[mpc] [" << i << "] af = "  << af << ",f = " << vehparam_->environment.f << ",g = " << vehparam_->environment.g << ",alpha = " << prediction_alpha_ 
            <<",ag = " << ag << ", aa = " << aa << ", CD = " << vehparam_->environment.cd << ",Af=" << vehparam_->Af
            << ",rho = " << vehparam_->environment.rho << ",M = " << vehparam_->environment.mass << std::endl;
#endif

    // Step5.2 : 构建 哈密顿函数 A B 系数
    ComputeHamiltonCoefficient(prediction_vel_points_.Back(), prediction_lambda_points_.Back());

    // Step5.3 : 求解 最优的扭矩 、最优速度 、最优lambda
    SolverOptimalSolution(prediction_vel_points_.Back(), aa, af, ag, 
                          prediction_best_Ft, prediction_best_v, prediction_best_lambda);
    
    // Step5.4 : 基于求出的最优解推算出下一步的对应坡度
    LongitudeStatePrediction(prediction_vel_points_.Back(), aa, af, ag,
                prediction_best_v, prediction_best_Ft, prediction_best_Fb, prediction_alpha_, prediction_station_); 

    // Step5.5 : 更新下一时刻的状态，更新状态给下一次循环
    prediction_vel_points_.PushBack(prediction_best_v);
    prediction_Ft_points_.PushBack(prediction_best_Ft);
    prediction_Fb_points_.PushBack(prediction_best_Fb);
    prediction_lambda_points_.PushBack(prediction_best_lambda);
    prediction_station_points_.PushBack(prediction_station_);
    prediction_slope_alpha_points_.PushBack(prediction_alpha_);

#if ENABLE_PACC_TRACE_DETAIL
    std::cout << "[mpc] [" << i << "] s = " << prediction_station_  << ", gear = " << int(input_->gear_num) << ", A = " << A_ << ", B = " << B_ << ", tarFt = " << -1.0 * (B_/2.0F/A_) 
              << ", Ft_i = " << prediction_best_Ft << ", v = " << prediction_best_v << ", lambda = " << prediction_best_lambda << std::endl;
#endif

/*
    Float32_t lambda_final = prediction_best_lambda - 2 * mpc_param_->kappa_2 * (prediction_best_v - v_ref_);
#if ENABLE_PACC_TRACE
      std::cout << "[mpc] [" << i << "]" << "Calc optimal soltion, lambda = " << prediction_best_lambda << ", v = " << prediction_best_v << ", te = " << prediction_best_torque << ", lambda_final = " << lambda_final << std::endl;
#endif

    if (common::com_abs(lambda_final) <= 0.05) {
#if ENABLE_PACC_TRACE
      std::cout << "[mpc] [" << i << "]" << "Find optimal soltion, lambda = " << prediction_best_lambda << ", v = " << prediction_best_v << ", te = " << prediction_best_torque << ", lambda_final = " << lambda_final << std::endl;
#endif
       // break;
    }
 
    if ( i > 0) {
      if (prediction_best_lambda * prediction_lambda_points_[i] < 0) {
  #if ENABLE_PACC_TRACE
        std::cout << "[mpc] [" << i << "]" << "Maybe optimal soltion, lambda = " << prediction_best_lambda << ", v = " << prediction_best_v << ", te = " << prediction_best_torque 
                  << ", pre lambda = " << prediction_lambda_points_[i] << ", lambda_final = " << lambda_final << std::endl;
  #endif
        // break;
      }
    }
*/
    // 到达最远的地图station, 退出预测迭代
    if (prediction_station_ > map_s_length_) {
      mpc_solution_state_ = MpcSolutionMapTooShort;
#if ENABLE_PACC_TRACE_DETAIL
      std::cout << "[mpc] End Slover because of exceeding map's length!, iteration number = " << i << std::endl;
#endif
      break;
    }
    mpc_solution_state_ = MpcSolutionUpperLimit;
  }
}

void LongitudinalModelPrediction::ComputeHamiltonCoefficient(const Float32_t &vel, const Float32_t &lambda) {
  delta_ = 1.0F + 12.0F * 14.0F / vehparam_->rw / vehparam_->rw / vehparam_->environment.mass + 
       20.0 * vehparam_->If * vehparam_->If * vehparam_->Ig[input_->gear_num] * vehparam_->Ig[input_->gear_num] * 
       vehparam_->eta / vehparam_->rw / vehparam_->rw / vehparam_->environment.mass;

  A_ = (Float32_t)((fuel_rate_param_->fuel_comsun_v_f.h20 +
               fuel_rate_param_->fuel_comsun_v_f.h21 * vel +
               fuel_rate_param_->fuel_comsun_v_f.h22 * (Float32_t)pow(vel, 2) + 
               fuel_rate_param_->fuel_comsun_v_f.h23 * (Float32_t)pow(vel, 3)) * mpc_param_->delta_t);
  
  B_ = (Float32_t)((fuel_rate_param_->fuel_comsun_v_f.h10 +
               fuel_rate_param_->fuel_comsun_v_f.h11 * vel +
               fuel_rate_param_->fuel_comsun_v_f.h12 * (Float32_t)pow(vel, 2) + 
               fuel_rate_param_->fuel_comsun_v_f.h13 * (Float32_t)pow(vel, 3)) * mpc_param_->delta_t + 
               lambda * mpc_param_->delta_t / vehparam_->environment.mass / delta_);
#if ENABLE_PACC_TRACE_DETAIL
  std::cout << "delta = " << delta_ << ", rw=" << vehparam_->rw << ", If=" << vehparam_->If << ", ig(n) = "  << vehparam_->Ig[input_->gear_num] 
            << ",v_i = " << vel << ", deltaT = " << mpc_param_->delta_t << std::endl; 
  std::cout << "A = " << A_ <<",h20 = " << fuel_rate_param_->fuel_comsun_v_f.h20 << ",h21 = " << fuel_rate_param_->fuel_comsun_v_f.h21 << ",h22 = " << fuel_rate_param_->fuel_comsun_v_f.h22 <<",h23 = "<< fuel_rate_param_->fuel_comsun_v_f.h23 << std::endl;
  std::cout << "B = " << B_ <<",h10 = " << fuel_rate_param_->fuel_comsun_v_f.h10 << ",h11 = " << fuel_rate_param_->fuel_comsun_v_f.h11 << ",h12 = " << fuel_rate_param_->fuel_comsun_v_f.h12 <<",h13 = "<< fuel_rate_param_->fuel_comsun_v_f.h13 << ", lambda = " << lambda << std::endl;
#endif

}

void LongitudinalModelPrediction::SolverOptimalSolution(const Float32_t &cur_vel, const Float32_t &air_acc,
                                                        const Float32_t &roll_acc, const Float32_t &slope_acc,
                                                        Float32_t &best_Ft, Float32_t &best_v, Float32_t &best_lambda){

  // 查找Ft上下限
  int ego_vel_index = 0;
  for (int i = 0; i < 200; ++i) {
    if (cur_vel <= ParaValue_VehMaxSpd[i]) {
      break;
    }
    ego_vel_index++;
  }
   
  int ego_vel_index_low = (ego_vel_index - 1) < 0 ? 0 : (ego_vel_index - 1);
  int ego_vel_index_up = ego_vel_index >= 200 ? 199 : ego_vel_index;

  Float32_t temp_proportion = (Float32_t)(cur_vel - ParaValue_VehMaxSpd[ego_vel_index_low]) / (ParaValue_VehMaxSpd[ego_vel_index_up] - ParaValue_VehMaxSpd[ego_vel_index_low]);

  if (temp_proportion == 0.0) {
    temp_cur_ft_min_ = (Float32_t)ParaValue_VehMinFt[ego_vel_index_low];
    temp_cur_ft_max_ = (Float32_t)ParaValue_VehMaxFt[ego_vel_index_low];
  } else if (temp_proportion == 1.0) {
    temp_cur_ft_min_ = (Float32_t)ParaValue_VehMinFt[ego_vel_index_up];
    temp_cur_ft_max_ = (Float32_t)ParaValue_VehMaxFt[ego_vel_index_up];
  } else {
    temp_cur_ft_min_ = (Float32_t)((1.0 - temp_proportion) * ParaValue_VehMinFt[ego_vel_index_low] + temp_proportion * ParaValue_VehMinFt[ego_vel_index_up]);
    temp_cur_ft_max_ = (Float32_t)((1.0 - temp_proportion) * ParaValue_VehMaxFt[ego_vel_index_low] + temp_proportion * ParaValue_VehMaxFt[ego_vel_index_up]);
  }

  // 哈密顿函数二次多项式求解 求解最优Ft
  Float32_t delt = -B_/2.0F/A_;

  if (A_ > 0) {
    if (delt >= temp_cur_ft_max_) {
      best_Ft = temp_cur_ft_max_;
    } else if (delt <= temp_cur_ft_min_) {
      best_Ft = temp_cur_ft_min_;
    } else {
      best_Ft = delt;
    }
  } else if (A_ < 0) {
    if (delt >= (0.5*(temp_cur_ft_min_ + temp_cur_ft_max_))) {
      best_Ft = temp_cur_ft_min_;
    } else {
      best_Ft = temp_cur_ft_max_;
    }
  } else {
    if (B_ >= 0){
      best_Ft = temp_cur_ft_min_;
    } else {
      best_Ft = temp_cur_ft_max_;
    }
  }

#if ENABLE_PACC_TRACE_DETAIL
  std::cout << "Ft_i = " << best_Ft << ",tarFt = " << delt << ",Ft_min = " << temp_cur_ft_min_ << ", Ft_max = " << temp_cur_ft_max_ << std::endl;
#endif

  Float32_t force_acc = best_Ft / vehparam_->environment.mass;
  Float32_t total_acc = (force_acc- roll_acc - slope_acc - air_acc * (Float32_t)pow(cur_vel, 2)) / delta_;
  best_v = (Float32_t)(cur_vel + mpc_param_->delta_t * total_acc);
#if ENABLE_PACC_TRACE_DETAIL
  std::cout << "V = " << best_v << ",v_i = " << cur_vel << ",a = " << total_acc 
            << ",force_acc = " << force_acc << ",roll_acc = " << roll_acc << ",slope_acc = " << slope_acc << ",air_acc = " << air_acc << ",delta_ = " << delta_ << std::endl;
#endif

  // 根据协态变量lambda的迭代方程求解下一个预测时刻的lambda
  Float32_t Q1_1 = fuel_rate_param_->fuel_comsun_v_f.h03 + fuel_rate_param_->fuel_comsun_v_f.h13 * best_Ft + fuel_rate_param_->fuel_comsun_v_f.h23 * (Float32_t)pow(best_Ft, 2);
  Float32_t Q1 = 3 * (Float32_t)pow(cur_vel, 2) * Q1_1;

#if ENABLE_PACC_TRACE_DETAIL
  std::cout << "Q1 = "  << Q1 << ", cur_vel = " << cur_vel << ", h03 = " << fuel_rate_param_->fuel_comsun_v_f.h03 << ", h13 = " << fuel_rate_param_->fuel_comsun_v_f.h13 
            << ", h23 = " << fuel_rate_param_->fuel_comsun_v_f.h23 << ", Ft_i = " << best_Ft << ", Q1_1 = " << Q1_1 << std::endl;
#endif 

  Float32_t Q2_1 = fuel_rate_param_->fuel_comsun_v_f.h02 + fuel_rate_param_->fuel_comsun_v_f.h12 * best_Ft + fuel_rate_param_->fuel_comsun_v_f.h22 * (Float32_t)pow(best_Ft, 2) + mpc_param_->kappa_1;
  Float32_t Q2 = 2 * cur_vel * Q2_1;

#if ENABLE_PACC_TRACE_DETAIL
  std::cout << "Q2 = "  << Q2 << ", h02 = " << fuel_rate_param_->fuel_comsun_v_f.h02 << ", h12 = " << fuel_rate_param_->fuel_comsun_v_f.h12
            << ", h22 = " << fuel_rate_param_->fuel_comsun_v_f.h22 << ", Ft_i = " << best_Ft << ", Q2_1 = " << Q2_1 << std::endl;
#endif

  Float32_t Q3 = fuel_rate_param_->fuel_comsun_v_f.h01 + fuel_rate_param_->fuel_comsun_v_f.h11 * best_Ft + fuel_rate_param_->fuel_comsun_v_f.h21 * pow(best_Ft, 2);

#if ENABLE_PACC_TRACE_DETAIL
  std::cout << "Q3 = "  << Q3 << ", h01 = " << fuel_rate_param_->fuel_comsun_v_f.h01 << ", h11 = " << fuel_rate_param_->fuel_comsun_v_f.h11
            << ", h21 = " << fuel_rate_param_->fuel_comsun_v_f.h21 << ", Ft_i = " << best_Ft << std::endl;
#endif

  Float32_t temp = Q1 + Q2  + Q3 - 2 * mpc_param_->kappa_1 * v_ref_;

  best_lambda = (Float32_t)(best_lambda - mpc_param_->delta_t * temp - 1) / (1 - 2 * air_acc * mpc_param_->delta_t * cur_vel / delta_);
  
#if ENABLE_PACC_TRACE_DETAIL
  std::cout << "Temp = "  << temp << ", Q1 = " << Q1 << ", Q2 = " << Q2 << ", Q3 = " << Q3 << ", K1 = " << mpc_param_->kappa_1 << ", v_ref = " << v_ref_ << std::endl;
#endif

#if ENABLE_PACC_TRACE_DETAIL
  std::cout << "A = "  << A_ << ",B = " << B_ << ",tarFt = " << delt << ",Ft_i = " << best_Ft << ",a = " << total_acc
            << ",v = " << best_v << ",temp = " << temp << ",lambda = " << best_lambda << std::endl;
#endif
}


void LongitudinalModelPrediction::LongitudeStatePrediction(const Float32_t &cur_vel, const Float32_t &air_acc,
                                                           const Float32_t &roll_acc, const Float32_t &slope_acc,
                                                           Float32_t &best_vel, Float32_t &best_Ft, Float32_t &best_Fb, 
                                                           Float32_t &next_slope_alpha, Float32_t &next_station){
  // Step1 : 对求出的最优车速和驱动力进行限幅
  Float32_t temp_Fb = 0.0;
  Float32_t Fb_min = -20000 / vehparam_->rw;
  Float32_t temp_v_min = std::max(constraint_->vmin, (v_ref_ + constraint_->ref_vd_limit_lower));
  Float32_t temp_v_max = std::min(constraint_->vmax, (v_ref_ + constraint_->ref_vd_limit_upper));

  bool is_use_brake = false;

  if (best_vel <= temp_v_min) {
    best_vel = temp_v_min;
    best_Ft = delta_ * vehparam_->environment.mass * (best_vel - cur_vel) / mpc_param_->delta_t  +
              vehparam_->environment.mass * (slope_acc + roll_acc + air_acc * pow(((best_vel + cur_vel) / 2), 2));
    
    if (best_Ft > temp_cur_ft_max_) {
      best_Ft = temp_cur_ft_max_;
    }
    
  } else {
    if (best_vel > temp_v_max) {
      is_use_brake = true;
      best_vel = temp_v_max;
      best_Ft = delta_ * vehparam_->environment.mass * (best_vel - cur_vel) / mpc_param_->delta_t  +
              vehparam_->environment.mass * (slope_acc + roll_acc + air_acc * pow(((best_vel + cur_vel) / 2), 2));

      if (best_Ft < temp_cur_ft_min_) {
        best_Ft = temp_cur_ft_min_;
        temp_Fb = best_Ft - delta_ * vehparam_->environment.mass * (best_vel - cur_vel) / mpc_param_->delta_t  +
                  vehparam_->environment.mass * (slope_acc + roll_acc + air_acc * pow(((best_vel + cur_vel) / 2), 2));

        if (temp_Fb < Fb_min) {
          temp_Fb = Fb_min;
        }
      }        
    }  
  }
   
  if (best_vel <= 0.0) {
    best_vel = 0.0;
  }
   

  // Step2 : 根据最优的车速进行预测
  // 根据 x , y , heading 进行 预测 还是 S L的坐标进行预测
  // XXX 目的是为了 插值 出 对应的 坡度值 ！！
  next_station = next_station + (best_vel + cur_vel) * mpc_param_->delta_t / 2;

  PACCPoint prediction_point;
  prediction_point.s = next_station;

  const Int32_t index = input_->pacc_map.points.LowerBound(prediction_point, FuncCmpPACCPoint());
  if (index < 1) {
    prediction_point.slope =  input_->pacc_map.points[0].slope;
  } else if (index >= input_->pacc_map.points.Size()) {
    prediction_point.slope = input_->pacc_map.points[input_->pacc_map.points.Size() - 1].slope;
  } else {
    const PACCPoint& point1 = input_->pacc_map.points[index - 1];
    const PACCPoint& point2 = input_->pacc_map.points[index];
    Float32_t slope_seg_length = point2.s -  point1.s;
    if (common::com_abs(slope_seg_length) < common::kMathEpsilonF) {
      prediction_point.slope = point1.slope;
    } else {
      // TODO: interpolate method
      Float32_t t = (prediction_point.s -  point1.s) / slope_seg_length;
      prediction_point.slope = (1.0F - t) *  point1.slope + t * point2.slope;
    }
  }

  // convert slope to rad 
  next_slope_alpha = atan(prediction_point.slope);

  best_Fb = temp_Fb;

#if ENABLE_PACC_TRACE_DETAIL
  std::cout << "S = "  << next_station << ",Ft_i = " << best_Ft << ",Fb_i = " << best_Fb
            << ",v_i = " << cur_vel << ",v_ii = " << best_vel << std::endl;
#endif  
}


Float32_t LongitudinalModelPrediction::GetNextAx() const {
  Float32_t target_Ft = 0.5 * (GetNextDriveForce() + GetNextNextDriveForce());
  Float32_t target_vel = GetNextVel();

#if ENABLE_PACC_TRACE
  std::cout << "目标的驱动力 : " << target_Ft << "N, 目标车速 : " 
            << target_vel << "m/s, 当前质量 : " << vehparam_->environment.mass 
            << "kg" << std::endl;
#endif

  // 计算驱动力 、加速阻力 、坡度阻力 、滚动阻力
  Float32_t Ff = vehparam_->environment.mass * vehparam_->environment.g * phoenix::common::com_cos(cur_slope_rad_) * vehparam_->environment.f;
  Float32_t Fw = 0.5 * vehparam_->Af * vehparam_->environment.cd * vehparam_->environment.rho * pow(target_vel, 2);
  Float32_t Fi = vehparam_->environment.mass * vehparam_->environment.g * phoenix::common::com_sin(cur_slope_rad_);

  Float32_t target_ax = (target_Ft - Ff - Fw - Fi) / delta_ / vehparam_->environment.mass;
#if ENABLE_PACC_TRACE
  std::cout << "当前坡度信息 : " << cur_slope_rad_ << "rad" 
            << " cos(β) = " << phoenix::common::com_cos(cur_slope_rad_) 
            << " sin(β) = " << phoenix::common::com_sin(cur_slope_rad_) << std::endl;  
  std::cout << "理想的驱动力 : " << target_Ft << "N, 滚动阻力 : " << Ff 
            << "N, 风阻 : " << Fw << "N, 坡度阻力 : " << Fi << "N, 目标加速度 : " << target_ax <<
            "m/s^2, 质量换算系数 : " << delta_ <<std::endl;
#endif
  return target_ax;
}

Float32_t LongitudinalModelPrediction::GetNextNe() const {
  Float32_t target_vel = GetNextVel();
  Float32_t target_ne = target_vel * vehparam_->If * vehparam_->Ig[input_->gear_num] * 30 / MATLAB_PI / vehparam_->rw;
  return target_ne;
}

