Float32_t DichotomySolution::GetTargetThrottle() {
  Float32_t temp_target_torque = target_torque_;

  Float32_t temp_engine_speed;
  Float32_t temp_engine_throttle;

  // 当踏板开度为大于标定阈值时，Kickdown请求被激活并发送（VECU计算），AMT系统根据车辆情况选择合适的档位（降档）实现车辆加速。
  // ZF的变速箱kickdown 为超过 96% 就会触发降档
  Float32_t kickdown_engine_torque_max = 2650.0F;
  const Float32_t PCC_THROTTLE_MAX = 70.0F;
  bool is_torque_limit = false;

  if (is_cur_engine_speed_) {
    temp_engine_speed = input_->engine_speed;
  } else {
    temp_engine_speed = target_ne_;
  }

  Float32_t ratio = 0;
  Int32_t lower = common::LerpInOrderedTable(constraint_.engine_speed_limit_table_for_engine_torque, temp_engine_speed, &ratio);
  Float32_t cur_torque_max =
        common::Lerp(constraint_.engine_speed_limit_table_for_engine_torque[lower].value, 
           constraint_.engine_speed_limit_table_for_engine_torque[lower + 1].value, ratio);

  // 空挡滑行[4%~14%]这种小油门好像无法退出空挡滑行
  if (temp_target_torque >= cur_torque_max && input_->engine_speed > 650.0) {
    temp_target_torque = cur_torque_max;
  }

  if (temp_target_torque >= kickdown_engine_torque_max) {
    is_torque_limit = true;
  }
  //FIXME: 通过坡度模型计算最大加速度，从而约束最大扭矩和油门
#if ENABLE_PCC_SLOPE_MODEL_LIMIT_TORQUE
  if (input_->engine_torque_limit > 0.0) {
    if (temp_target_torque >= input_->engine_torque_limit) {
      temp_target_torque = input_->engine_torque_limit;
      is_torque_limit = true;
    }
  }
#endif

  int target_engine_speed_index = 0;
  int target_torque_index = 0;

  for (int i = 0; i < 22; ++i) {
    if (temp_engine_speed <= target_engine_speed_table[i]) {
      break;
    }
    target_engine_speed_index++;
  }
   
  target_engine_speed_index = (target_engine_speed_index - 1) < 0 ? 0 : (target_engine_speed_index - 1);

  for (int i = 0; i < 69; ++i) {
    if (temp_target_torque <= target_torque_table[i]) {
      break;
    }
    target_torque_index++;
  }

  target_torque_index = (target_torque_index - 1) < 0 ? 0 : (target_torque_index - 1);

  temp_engine_throttle = target_engine_throttle_table[target_engine_speed_index][target_torque_index];
  if (input_->planning_debug_ != Nullptr_t) {
    input_->planning_debug_->pacc.internal.tar_throttle_from_table = temp_engine_throttle;
  }

#if ENABLE_PACC_TRACE
  std::cout << "target_engine_speed_index = " <<  target_engine_speed_index 
            << ", target_torque_index = "<< target_torque_index 
            << ", target_engine_speed_table[target_engine_speed_index] = "
            << target_engine_speed_table[target_engine_speed_index] 
            << ", target_torque_table[target_torque_index] = "
            << target_torque_table[target_torque_index] 
            << ", temp_engine_throttle = "<< temp_engine_throttle << std::endl;
#endif

  /**
   * @brief 在长上坡路段, 根据驾驶员经验，设定不同坡度的最大油门开度
   * 坡度(%)   : 油门开度
   * (1.5, 2.0] : 40
   * (2.0, 3.0] : 45
   * (3.0, 4.0] : 50
   * (4.0, 4.5] : 60
   * (4.5, ~] : 65
   * 根据上述经验值,拟合二次多项式曲线
   */
  float temp_cur_slope = input_->pacc_map.points[0].slope * 100.0F;
  float temp_engine_throttle_limit = 2.3361 * temp_cur_slope * temp_cur_slope - 7.9669 * temp_cur_slope + 47.771;

#if ENABLE_PCC_SLOPE_MODEL_LIMIT_TORQUE // 对于TBOX地图无效的场景, 也根据坡度限制油门开度
  if (input_->ego_mass < 40000.0 && temp_cur_slope > 1.5F && input_->pacc_map.pacc_points_source == 2) {
    if (temp_engine_throttle >= temp_engine_throttle_limit) {
      temp_engine_throttle = temp_engine_throttle_limit;
    }
  }
#else // 根据坡度限制油门开度
  if (input_->ego_mass < 40000.0 && temp_cur_slope > 1.5F) {
    if (temp_engine_throttle >= temp_engine_throttle_limit) {
      temp_engine_throttle = temp_engine_throttle_limit;
    }
  }
#endif

  // TODO: 限制PCC最大油门开度, 需测试满载在大上坡时的动力性
#if ENABLE_PCC_UPPER_LIMIT_THROTTLE
  if (temp_engine_throttle >= PCC_THROTTLE_MAX) {
      temp_engine_throttle = PCC_THROTTLE_MAX;
  }
#endif

  // 当踏板开度为大于标定阈值时，Kickdown请求被激活并发送（VECU计算），AMT系统根据车辆情况选择合适的档位（降档）实现车辆加速。
  // ZF的变速箱kickdown 为超过 98% 就会触发降档
  bool kickdown_flag = false;
  bool is_kickdown_succeed = false;
  bool is_has_risingflag = false;

  bool end_kickdown_count;

  if (is_kickdown_control_) {
    if (VELOCITY_PLANNING_TARGET_TYPE_PCC != input_->pre_velocity_planning_type) {
      kickdown_count_.Clear();
    }
    // 第一种 脱档状态 第二种 ig_map 是否需要 kickdown
    if ((input_->engine_speed > 650.0F && input_->engine_speed <= 860.0F &&
        temp_cur_slope > 1.50F && input_->gear_num >= 11)/* || 
        (input_->engine_speed < 950.0F && input_->gear_num > target_gear_ && 
         input_->engine_speed > 650.0F)*/) {
        kickdown_flag = true;
    } else {
        kickdown_flag = false;
    }

    // 判断是继续发 kickdown指令 
    if(pre_target_throttle_ > 97.0 && pre_chassis_gear_num_ > input_->gear_num) {
    // kickdown 成功 
      is_kickdown_succeed = true;
    } else {
      is_kickdown_succeed = false;
    }
    
    if (true == is_kickdown_succeed && false == pre_kickdown_flag_) {
      is_has_risingflag = true;  // kickdown 成功的上升沿的信号
    } else {
      is_has_risingflag = false;
    }

    if (is_has_risingflag) {
      kickdown_count_.Clear();
    }

    if (is_has_risingflag && kickdown_count_.GetResultState()) {
      end_kickdown_count = true; // 超出计数范围--代表可以继续 kickdown了
    } else if (!is_has_risingflag && !kickdown_count_.GetResultState()) {
      end_kickdown_count = true; // 没有上升沿信号 和 开始计数也可以继续 kickdown了
    } else {
      end_kickdown_count = false;
    }
 
    if (kickdown_count_.GetResultState() && kickdown_flag) {
      // 超出计数范围 、满足 kickdown 条件
      temp_engine_throttle = 98.0F;
    }

    kickdown_count_.Kickdown_Count_start(end_kickdown_count);

    pre_kickdown_flag_ =  is_kickdown_succeed;  
  }

  
  if (temp_engine_throttle >= 98.0F) {
    temp_engine_throttle = 98.0F;
  }
  
  pre_target_throttle_ = temp_engine_throttle;
  pre_chassis_gear_num_ = input_->gear_num;
  return temp_engine_throttle;
}

