void DichotomySolution::TargetTorqueLimit() {
  
  Float32_t delta_torque_limit = 40.0;             // 与上一帧目标扭矩的进行比较的限制
  Float32_t cur_delta_torque_limit = 1000.0;       // 与底盘实际扭矩的进行比较的限制

  Float32_t temp_target_torque = target_torque_;  // Pcc 计算的目标的扭矩[N/m]
  Float32_t temp_pre_torque = pre_target_torque_; // 上一帧实际下发的扭矩[N/m]

  Float32_t temp_engine_speed = input_->engine_speed;
  
  /**
   * @brief 平滑扭矩变化率，避免当前扭矩与上一帧扭矩变化太大
   * 
   */
  Float32_t delta_torque = temp_target_torque - temp_pre_torque;

  #if H19E_ZF
  // 10 档 跳 12档了 出现跳档的情况
  if (input_->gear_num >= 11) {
    if (temp_target_torque > 2300 && 
        input_->engine_torque > 2400) {
      delta_torque_limit = 2.0;
    } else {
      delta_torque_limit = 10.0;
    }
  }
  #endif

  // TODO:在要释放油门可以不限制
  if (common::com_abs(delta_torque) <= delta_torque_limit) {
    temp_target_torque = target_torque_;
  } else {
    if (delta_torque > 0) {
      temp_target_torque = temp_pre_torque + delta_torque_limit;
    } else {
      // nothing
      /*temp_target_torque = temp_pre_torque - delta_torque_limit;*/
    }
  }

  /**
   * @brief 处理换挡时，底盘扭矩为0的场景
   * 
   */
  // 与当前扭矩进行比较 因为在换挡的过程中存在动力几乎丢失情况 就是底盘上来的扭矩为0
  // 之间在鸟语林调试时候换挡的过程大改1~2s 目的是在这过程中停止喷油
  // 但是这么改会出现在上坡的时候换挡的时候给油不及时-从而进行掉速的情况
  // 在速度规划上一帧还是pcc的状态不进行比较了
  // 越过怠速区
  if ((temp_engine_speed > 650) &&
      (input_->gear_num >= 11)) {
    cur_delta_torque_limit = 400.0;
  }

  Float32_t cur_data_torque = temp_target_torque - input_->engine_torque;
  if ((VELOCITY_PLANNING_TARGET_TYPE_PCC != input_->pre_velocity_planning_type)
      /*|| (input_->gear_num >= 12)*/) {
       // 此处的 11 档 是可以动态调整的
    if (common::com_abs(cur_data_torque) <= cur_delta_torque_limit) {
    // nothing
    } else {
      if (cur_data_torque > 0) {
        temp_target_torque = input_->engine_torque + delta_torque_limit;
      } else {
        // nothing
        /*temp_target_torque = input_->engine_torque - delta_torque_limit;*/
      }
    }
  }

  /**
   * @brief 限幅，根据转速约束扭矩上限
   * 
   */
  //TODO: 当前转速 vs 请求转速
  Float32_t ratio = 0;
  Int32_t lower = common::LerpInOrderedTable(constraint_.engine_speed_limit_table_for_engine_torque, temp_engine_speed, &ratio);
  Float32_t cur_torque_max =
        common::Lerp(constraint_.engine_speed_limit_table_for_engine_torque[lower].value, 
           constraint_.engine_speed_limit_table_for_engine_torque[lower + 1].value, ratio);
  
  // 空挡滑行[4%~14%]这种小油门好像无法退出空挡滑行
  if (temp_target_torque >= cur_torque_max && input_->engine_speed > 650.0) {
    temp_target_torque = cur_torque_max;
  }

  target_torque_ = temp_target_torque;
}

void DichotomySolution::TargetAxLimitBaseTorque(Uint8_t gear_num) {

  Float32_t Ft = lon_dyn_param_.eta * lon_dyn_param_.If * lon_dyn_param_.Ig[gear_num] * target_torque_ / lon_dyn_param_.rw;

  Float32_t cur_resistance = GetCurrentResistance();

  Float32_t MassConversionFactor = 1 + 12 * 14 / lon_dyn_param_.rw / lon_dyn_param_.rw / lon_dyn_param_.environment.mass + 
       20 * lon_dyn_param_.If * lon_dyn_param_.If * lon_dyn_param_.Ig[gear_num] * lon_dyn_param_.Ig[gear_num] * 
       lon_dyn_param_.eta / lon_dyn_param_.rw / lon_dyn_param_.rw / lon_dyn_param_.environment.mass;

  Float32_t target_ax = (Ft - cur_resistance) / MassConversionFactor / lon_dyn_param_.environment.mass;

  target_ax_ = target_ax;

  return;

}

Float32_t DichotomySolution::GetCurrentResistance() const {
  Float32_t cur_slope_rad = atan(input_->pacc_map.points[0].slope);
  Float32_t Ff = GetCurrentFf();
  Float32_t Fw = GetCurrentFw();
  Float32_t Fi = GetCurrentFi();
  return Ff + Fw + Fi;
}

Float32_t DichotomySolution::GetCurrentFf() const {
  Float32_t cur_slope_rad = atan(input_->pacc_map.points[0].slope);
  Float32_t Ff = lon_dyn_param_.environment.mass * lon_dyn_param_.environment.g * phoenix::common::com_cos(cur_slope_rad) * lon_dyn_param_.environment.f;
  return Ff;
}

Float32_t DichotomySolution::GetCurrentFw() const {
  Float32_t Fw = 0.5 * lon_dyn_param_.Af * lon_dyn_param_.environment.cd * lon_dyn_param_.environment.rho * pow(input_->ego_speed, 2);
  return Fw;
}

Float32_t DichotomySolution::GetCurrentFi() const {
  Float32_t cur_slope_rad = atan(input_->pacc_map.points[0].slope);
  Float32_t Fi = lon_dyn_param_.environment.mass * lon_dyn_param_.environment.g * phoenix::common::com_sin(cur_slope_rad);
  return Fi;
}

void DichotomySolution::TargetVxLimitBaseTorque() {
  if (phoenix::planning::VELOCITY_PLANNING_PCC_TYPE_CRUISE == cur_pcc_mode_) {
    target_vel_ = input_->ego_speed + target_ax_ * cc_param_mpc_.delta_t;
  } else if (phoenix::planning::VELOCITY_PLANNING_PCC_TYPE_FOLLOW == cur_pcc_mode_) {
    target_vel_ = input_->ego_speed + target_ax_ * follow_param_mpc_.delta_t;
  }
  return;
}

void DichotomySolution::TargetNeLimitBaseTorque(Uint8_t gear_num) {
  target_ne_ = target_vel_ * lon_dyn_param_.If * lon_dyn_param_.Ig[gear_num] * 30 / MATLAB_PI / lon_dyn_param_.rw;
}

void DichotomySolution::UpdateTargetTorqueFromDriveForce(Uint8_t gear_num) {

  target_torque_ = (Float32_t)(target_Ft_ * lon_dyn_param_.rw / (lon_dyn_param_.Ig[gear_num] * lon_dyn_param_.If * lon_dyn_param_.eta));

}

Uint8_t DichotomySolution::UpdateTargetGear() {

  int target_vel_dimension  = sizeof(target_vel_table) / sizeof(float) - 1;
  int target_Ft_dimension  = sizeof(target_Ft_table) / sizeof(float) - 1;
  Float32_t temp_target_vel = middle_model_prediction_.GetNextVel();

  Uint8_t temp_gear = Two_Lookup_Table(temp_target_vel, target_Ft_, target_vel_table, target_Ft_table, target_gear_table, target_vel_dimension, target_Ft_dimension);

  return temp_gear;
}

Uint8_t DichotomySolution::Two_Lookup_Table(float x, float y, const float x_table[],
  const float y_table[], const uint8_t table[], const uint32_t maxIndex_x,const uint32_t maxIndex_y) {
  
  uint32_t temp_Id;
  uint32_t Id_Left;
  uint32_t Id_Rght;
  // x轴的索引
  uint32_t x_id;
  if (x <= x_table[0U]) {
    Id_Left = 0U;
  } else if (x < x_table[maxIndex_x]) {
    temp_Id = maxIndex_x / 2;
    Id_Left = 0U;
    Id_Rght = maxIndex_x;

    while (Id_Rght - Id_Left > 1U) {
      if (x < x_table[temp_Id]) {
        Id_Rght = temp_Id;
      } else {
        Id_Left = temp_Id;
      }

      temp_Id = (Id_Rght + Id_Left)/ 2;
    }

    if ((Id_Left < maxIndex_x) && (x_table[Id_Left + 1U] - x <= x - x_table[Id_Left])) {
      Id_Left++;
    }
  } else {
    Id_Left = maxIndex_x;
  }
  x_id = Id_Left;

  // y轴的索引
  uint32_t y_id;
  if (y <= y_table[0U]) {
    Id_Left = 0U;
  } else if (y < y_table[maxIndex_y]) {
    /* Binary Search */
    temp_Id = maxIndex_y / 2;
    Id_Left = 0U;
    Id_Rght = maxIndex_y;
    while (Id_Rght - Id_Left > 1U) {
      if (y < y_table[temp_Id]) {
        Id_Rght = temp_Id;
      } else {
        Id_Left = temp_Id;
      }

      temp_Id = (Id_Rght + Id_Left) / 2;
    }

    if ((Id_Left < maxIndex_y) && (y_table[Id_Left + 1U] - y <= y - y_table[Id_Left])) {
      Id_Left++;
    }
  } else {
    Id_Left = maxIndex_y;
  }

  y_id = Id_Left;
  //TODO matlab由二维数组转成一维数组的时候是按列转化的！！！
  uint32_t temp_index = (maxIndex_y + 1) * (y_id) + x_id;

  if (temp_index > 39999) {
    temp_index = 39999;
  }
  
  return table[temp_index];
  // return table[(maxIndex_x + 1) * (x_id) + y_id];
}

Float32_t DichotomySolution::UpdateDriveForceFromTarget(const Float32_t cur_engine_speed, const Float32_t cur_engine_torque, const Float32_t cur_ego_speed) {
  
  Float32_t curr_Ft = cur_engine_torque * cur_engine_speed * 100.0F / cur_ego_speed / 955.0F;

  return curr_Ft;

}

