PAccOutput VelocityPlanningPACC::Plan(const PAccInput &input) {
  ad_msg::Obstacle cipv;
  solution_.Plan(input, false, cipv);

  PAccOutput output;
  output.tar_v = solution_.GetTargetVel();
  output.target_unlimit_vel = solution_.GetTargetUlimitVel();
  output.tar_a = solution_.GetTargetAx();
  output.tar_gear = solution_.GetTargetGear();
  output.tar_gear_vaild = solution_.GetTargetGearIsVaild();
  output.tar_engine_torque = solution_.GetTargetTorque();
  output.tar_drive_force = solution_.GetTargetDriveForce();
  output.cur_resistance = solution_.GetCurrentResistance();
  output.cur_Ff = solution_.GetCurrentFf();
  output.cur_Fw = solution_.GetCurrentFw();
  output.cur_Fi = solution_.GetCurrentFi();
  output.tar_engine_ne = solution_.GetTargetNe();
  output.tar_engine_throttle = solution_.GetTargetThrottle();
  output.dichotomy_solution_state = solution_.GetDichotomySolutionState();
  output.mpc_solution_state = solution_.GetMiddleMpcSolutionState();
  output.pcc_vel_plan_type = solution_.GetPccVelPlanType();
  output.pcc_result_vaild = solution_.GetResultVaild();
  return output;
}

